import React from 'react';
import './App.css';
import Login from "./login/Login";
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  // componentDidMount() {
  //   fetch('/api')
  //     .then(res => res.text())
  //     .then(text => console.log(text));
  // }

  return (
    <div className="wrapper">
      <h1>Application</h1>
      <BrowserRouter>
        <Routes>
          <Route exact path="/login" element={<Login/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
